  const { login } = useAuth();
  const [name, setName] = useState("");

  return (
    <div>
      <h1>Login</h1>
      <label>UserName</label>
      <input type="text" name="name" id="name" placeholder="Enter userName" />
      <button>Login</button>
    </div>
  );
}
export default Login;
